// export const getgOWNDAMANYComedyAction = () => ({ type: GOWNDAMANY_COMEDY });
// export const subscribeAction = () => ({ type: SUBSCRIBE_CHANNEL });
const initialValue = {
  // img:
  //   'data:image/jpeg;base64,',
  // isSubscribed: false,
  loading: false,
  data: [],
  error: '',
};
//reducers
const LoginReducer = (state = initialValue, actions) => {
  switch (actions.type) {
    case 'LOGIN_START':
      return {
        loading: true,
        ...state,
      };
    case 'LOGIN_SUCCESS':
      return {
        loading: false,
        data: actions.payload,
        error: '',
      };
    case 'LOGIN_FAIL':
      return {
        loading: false,
        data: [],
        error: actions.error,
      };
    // case SUBSCRIBE_CHANNEL:
    //   return {
    //     img:
    //       'data:image/jpeg;base64,',
    //     isSubscribed: !state.isSubscribed,
    //   };
    // case VADIVELU_COMEDY:
    //   return {
    //     ...state,
    //     img:
    //       'data:image/jpeg;base64,',
    //   };
    // case GOWNDAMANY_COMEDY:
    //   return {
    //     ...state,
    //     img:
    //       'data:image/jpeg;base64,',
    //   };
    default:
      return {
        ...state,
      };
  }
};
// store
let store = createStore(LoginReducer, applyMiddleware(thunk));

//dispatchh..
//store.dispatch(getVadiveluComedyAction());
//store.dispatch(getgOWNDAMANYComedyAction());

ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
